import {
  BrowserRouter,
  Navigate,
  Route,
  Routes,
  useNavigate,
} from "react-router-dom";
import HomePage from "./homePage/HomePage";
import Login from "./login/Login";

function App() {
  const token: any = localStorage.getItem("access_token");
  const checkToken = (token: any) => {
    return token ? <Navigate to="/HomePage" /> : <Navigate to="/login" />;
  };

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/login" element={checkToken(token)} />
        <Route path="/HomePage" element={checkToken(token)} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
